import React from 'react'

const buttons = [
    {
        name: 'Hello',
    },
    {
        name: 'World',
    },
    {
        name: 'Valera',
    },
    {
        name: 'Andrey',
    },
];

const Menu = () => (
    <div className={'menu'}>
        {buttons.map((button, key) => <div key={key}>{button.name}</div>)}
    </div>
);

export default Menu
